import React from "react";
import styles from "../css/Card.module.css";

const Card = (props) => {
  return (
    <div
      className={
        styles.card && props.id !== "login"
          ? styles.card && styles.blurred
          : styles.card
      }
    >
      {props.children}
    </div>
  );
};

export default Card;
